import React, { Component } from "react";
import API from "../utils/API";
import {Col, Row, Container} from "../components/Grid";
import Nav from "../components/Nav";
import OutlineBtn from "../components/DeleteBtn/index.js";
import Modal from "../components/Modal/index.js";
import logo from "../images/logo_2.png";

import test from "../images/phone_pic.png";
import top from "../images/pizza_image.png";
import ("../pages/landing.css");



class Landing extends Component {

    state={
        users:{},
        username:"",
        password:"",
        show:false
    }

    componentDidMount(){
        this.loadLanding();
    }

    loadLanding = () => {
        API.getUsers()
          .then(res =>
            this.setState({ users: res.data, username:"", password:""})
          )
          .catch(err => console.log(err));
      };

      work = () => {
        this.setState({ show: true });
      }

     render(){
        return(
            <Container>
                
                <Nav>
                <Col size="md">
     
                <a className="navbar-brand" href="/">
                <img src={logo} alt="logo"/> 
                </a>
     
      
     </Col >
     <Col size="md"></Col>
      <Col size="offset-md">
      
      <OutlineBtn style={{marginRight:10}} data-toggle="modal" data-target="#exampleModal" onClick={this.work}>Log-In<i className="fas fa-sign-in-alt"></i></OutlineBtn>

      </Col>
                
                    <OutlineBtn style={{alignSelf:"left"}}>Sign-Up <i class="fas fa-camera-retro"></i></OutlineBtn>
                    </Nav>
                
                <div className="landing-head">
                
        
                </div>
               

                <div className="hero-text" style={{marginTop:70, zIndex:5}}>

<h1>A picture <br>
</br>is worth a thousand <br></br>words...</h1>





</div>
<Modal show={this.state.show} handleClose={this.hideModal}>
          <p>Modal</p>
          <p>Data</p>
        </Modal>

                
                

            
            
            
            
           

           

            

           


            
           
            </Container>
        )
    }
    
}

export default Landing;
